    .then(result => alert(JSON.parse(result).body))
    .catch(error => console.log('error', error));
  };


  return(
    <>
      <title>Home</title>
      <h1>Courses</h1>
      <form>
      <label>First Name :</label>
      <input type="text" id="fName"></input>
      <label>Last Name :</label>
      <input type="text" id="lName"></input>
      <button type="button" 
      onClick="callAPI">
        Call API</button>
        </form>
    </>
  )
  };

  export default Home;
